<section id="what-we-do" data-effect="fadeIn" data-width="split" class="page-id-5542 entry-content normal-background ut-split-screen light   ">

<a class="ut-offset-anchor"  id="section-what-we-do" name="section-what-we-do">what-we-do</a>










<div class="grid-40 prefix-5 suffix-5 tablet-grid-40 tablet-prefix-5 tablet-suffix-5 mobile-grid-100 ut-split-content-left">


<header class="parallax-header pt-style-4 ">
<h2 class="parallax-title ut-glow"><span>O Nas</span></h2>


<div class="lead"><p>Astromal Sp. z o.o. istnieje na polskim rynku od ponad trzydziestu lat. Ciagly rozwoj i chec zaspokojenia potrzeb coraz bardziej wymagajacego rynku, sprawiaja, ze wciaz poszerzamy swoja oferte, zarowno na plaszczyznie koncepcyjnej, jak i produkcyjnej. Od lat zwiazani jestesmy z przemyslem komunikacyjnym, od lat rowniez jestesmy wiernymi kibicami i milosnikami sportu zuzlowego, ktory zreszta zawsze byl w naszej firmie obecny. </p>
</div>


</header>




</div> <!-- end /grid-40 prefix-5 -->

<div class="grid-50 tablet-grid-50 mobile-grid-100 ut-split-screen-poster" data-posterparent="what-we-do"></div>








<div class="ut-scroll-up-waypoint" data-section="section-what-we-do" ></div>

</section>

<div class="clear"></div>








<section id="civilian-craft" data-effect="fadeIn" data-width="split" class="page-id-5545 entry-content normal-background ut-split-screen light   ">

<a class="ut-offset-anchor" data-parent="section-what-we-do" id="section-civilian-craft" name="section-civilian-craft">civilian-craft</a>









<div class="grid-50 tablet-grid-50 mobile-grid-100 tablet-grid-50 mobile-grid-100 ut-split-screen-poster" data-posterparent="civilian-craft"></div>

<div class="grid-40 prefix-5 suffix-5 tablet-grid-40 tablet-prefix-5 tablet-suffix-5 mobile-grid-100 ut-split-content-right">


<header class="parallax-header pt-style-4 ">

<h2 class="parallax-title ut-glow"><span>Profesjonalizm</span></h2>


<div class="lead"><p>Sponsorujemy zawodnikow indywidualnych, a takze nasza druzyne, Unie Leszno. Pasja ta zainspirowala nas rowniez do opracowania szeregu akcesoriow i oslon do maszyn zuzlowych. Sluzymy tez pomoca w sferze koncepcyjnej i produkcyjnej nowych motocykli i ich oprzyrzadowania. Gwarantujemy rzetelnosc, terminowosc, bardzo dobra jakosc produktow i uslug. Do naszej pracy podchodzimy z pasja i zaangazowaniem kibica.</p>
</div>


</header>




</div> <!-- end /grid-40 prefix-5 -->






<div class="ut-scroll-up-waypoint" data-section="section-civilian-craft" data-parent="section-what-we-do"></div>

</section>

<div class="clear"></div>








<section id="military-craft" data-effect="fadeIn" data-width="split" class="page-id-5547 entry-content normal-background ut-split-screen light   ">

<a class="ut-offset-anchor" data-parent="section-what-we-do" id="section-military-craft" name="section-military-craft">military-craft</a>










<div class="grid-40 prefix-5 suffix-5 tablet-grid-40 tablet-prefix-5 tablet-suffix-5 mobile-grid-100 ut-split-content-left">


<header class="parallax-header pt-style-4 ">
<h2 class="parallax-title ut-glow"><span>Design</span></h2>


<div class="lead"><p>Dzieki zdobywanemu przez lata doswiadczeniu, zarowno w sferze koncepcji, jak i technologii produkcji wielu elementow, w tym glownie dla przemyslu komunikacyjnego, jak rowniez dzieki ogromnemu zainteresowaniu i fascynacji sportem zuzlowym zdobylismy odpowiednia wiedze i umiejetnosci, aby moc zaoferowac naszym Klientom pomoc w zakresie projektowania indywidualnych konstrukcji motocykli zuzlowych. To nieopisana przyjemnosc uczestniczyc w takim przedsiewzieciu. Kazdy projekt powstaje w scislej wspolpracy z Klientem, my staramy sie przyslowiowo przeniesc na papier i urzeczywistnic jego wizje motocykla, jego oczekiwania, jego marzenia. Efekty sa zawsze niezwykle...</p>
</div>


</header>




</div> <!-- end /grid-40 prefix-5 -->

