<div class="dv-panel-inner">
<p>Silnik, jeden z najwazniejszych i najbardziej delikatnych elementow motocykla, zasluguje na najlepsze. Nie tylko w eksploatacji, ale tez w transporcie. Stworzylismy bardzo ergonomiczna i praktyczna skrzynie transportowa, ktora idealnie spelnia swoje zadanie. Jest wytrzymala, bardzo wygodna w przenoszeniu, w pelni wodoszczelna. Zapewnia doskonale zabezpieczenie silnika.<br />
