<link rel='stylesheet' id='all_around-fonts-css' href='https://fonts.googleapis.com/css?family=Titillium+Web:600,400&amp;subset=latin-ext' type='text/css' media='all' /> <script> (function($){ $(document).ready(function(){ var image_array = new Array(); image_array = [ {image: 'https://speedwayparts.pl/wp-content/uploads/2018/07/piotr-pawlicki-61fb572c65ff358f9c4a5dbdf6724aef-270x270.jpg', link_url: 'https://speedwayparts.pl/wp-content/uploads/2018/07/piotr-pawlicki.jpg', link_rel: 'prettyPhoto', link_target: '_self', main_link: '', main_link_target: '0', upper_text_label_show: 0, upper_text_label: '', upper_text_label_style: '', lower_text_label_show: 0, lower_text_label: '', lower_text_label_style: ''}, {image: 'https://speedwayparts.pl/wp-content/uploads/2016/01/z-zmarzlik-3a30cad2cfbe60cce45d3027e2a82241-200x200.jpg', link_url: 'https://speedwayparts.pl/wp-content/uploads/2016/01/z-zmarzlik.jpg', link_rel: 'prettyPhoto', link_target: '_self', main_link: '', main_link_target: '0', upper_text_label_show: 0, upper_text_label: '', upper_text_label_style: '', lower_text_label_show: 0, lower_text_label: '', lower_text_label_style: ''}, {image: 'https://speedwayparts.pl/wp-content/uploads/2016/01/z-kasprzak-0a022af7a7129bc946c7229aac5b22c8-250x250.jpg', link_url: 'https://speedwayparts.pl/wp-content/uploads/2016/01/z-kasprzak.jpg', link_rel: 'prettyPhoto', link_target: '_self', main_link: '', main_link_target: '0', upper_text_label_show: 0, upper_text_label: '', upper_text_label_style: '', lower_text_label_show: 0, lower_text_label: '', lower_text_label_style: ''}, {image: 'https://speedwayparts.pl/wp-content/uploads/2018/07/t-musielak-e4c7225c6968c83abcac4f06a1b76ec9-270x270.jpg', link_url: 'https://speedwayparts.pl/wp-content/uploads/2018/07/t-musielak.jpg', link_rel: 'prettyPhoto', link_target: '_self', main_link: '', main_link_target: '0', upper_text_label_show: 0, upper_text_label: '', upper_text_label_style: '', lower_text_label_show: 0, lower_text_label: '', lower_text_label_style: ''}, {image: 'https://speedwayparts.pl/wp-content/uploads/2018/07/przemek-pawlicki-0a3c4cec1e8acb486edf8bc867e129e6-270x270.jpg', link_url: 'https://speedwayparts.pl/wp-content/uploads/2018/07/przemek-pawlicki.jpg', link_rel: 'prettyPhoto', link_target: '_self', main_link: '', main_link_target: '0', upper_text_label_show: 0, upper_text_label: '', upper_text_label_style: '', lower_text_label_show: 0, lower_text_label: '', lower_text_label_style: ''} ]; $('#all_around_slider_1').content_slider({ map: image_array, plugin_url: 'https://speedwayparts.pl/wp-content/plugins/all_around/', max_shown_items: 5, responsive_by_available_space: 1, wrapper_text_max_height: 450, prettyPhoto_color: "#1ab99b", hide_prettyPhoto: 1, enable_mousewheel: 0, enable_scroll_with_touchmove_on_vertical_version: 1 }); }); })(jQuery); </script> <div class="content_slider_wrapper" id="all_around_slider_1"> <div class="circle_slider_text_wrapper" id="sw0" style="display: none;"> <div class="content_slider_text_block_wrap"> <h3 style="font-family: 'Titillium Web' !important;">Piotr Pawlicki</h3><br /><br /> <br /><span style="font-family: 'Titillium Web' !important;">Speedway w obudowie Astromal wyglada swietnie. Sportowo, oplywowo, co najwazniejsze nie traci zuzlowego charakteru, a o to chodzi. Jest calkowicie dopasowany do moich potrzeb i upodoban, a przy okazji wytrzymaly i praktyczny. W rozmowach z kolegami ze srodowiska zuzlowego wiekszosc podejmuje ze mna temat moich blotnikow, jest to bardzo mile. Oznacza to, ze moi rywale nie przechodza obok moich maszyn obojetnie, a to dodaje mi pewnosci siebie </span><br /> </div> <div class="clear"></div> </div> <div class="circle_slider_text_wrapper" id="sw1" style="display: none;"> <div class="content_slider_text_block_wrap"> <h3 style="font-family: 'Titillium Web' !important;">Bartosz Zmarzlik</h3><br /><br /> <br /><span style="font-family: 'Titillium Web' !important;">Astromal produkuje swietne akcesoria zuzlowe. <br>Blotniki sa wytrzymale, cala obudowa lekka i w ogole nie przeszkadza w jezdzie. <br>A efekt wizualny jest naprawde niezly. Pelna dowolnosc w kolorystyce, symbolach, grafice. <br>Mam dokladnie to, co chce, a to dla mnie bardzo wazne. <br>Polecam wszystkim kochajacym zuzel i motocykle. </span><br /> </div> <div class="clear"></div> </div> <div class="circle_slider_text_wrapper" id="sw2" style="display: none;"> <div class="content_slider_text_block_wrap"> <h3 style="font-family: 'Titillium Web' !important;">Krzysztof Kasprzak</h3><br /><br /> <br /><span style="font-family: 'Titillium Web' !important;">Wspolpracuje z firma Astromal od 10 lat. Produkty tej firmy sa niezawodne, piekne i niezniszczalne. Motocykle wygladaja tak jak powinny i tak jak tego oczekuje. Zawsze wszystko mam zrobione na 100% i na czas. A w zuzlu takie rzeczy sa niezbedne do prawidlowego funkcjonowania teamu. Zawsze mam zrobione wszystkie wzory akcesoriow pod moj styl i moje wyobrazenie. Polecam akcesoria firmy Astromal. Musicie sami sie przekonac jak dobrej jakosci sa to produkty.</span><br /> </div> <div class="clear"></div> </div> <div class="circle_slider_text_wrapper" id="sw3" style="display: none;"> <div class="content_slider_text_block_wrap"> <h3 style="font-family: 'Titillium Web' !important;">Tobiasz Musielak</h3><br /><br /> <br /><span style="font-family: 'Titillium Web' !important;">W koncu firma, ktora naprawde zna sie na tym co robi. I w dodatku wspolpracuje z klientem. Omowilismy dokladnie projekt, otrzymalem kilka naprawde praktycznych sugestii i propozycji. Finalnie jestem zadowolony, a moj motocykl wyglada swietnie. I o to chodzi.</span><br /> </div> <div class="clear"></div> </div> <div class="circle_slider_text_wrapper" id="sw4" style="display: none;"> <div class="content_slider_text_block_wrap"> <h3 style="font-family: 'Titillium Web' !important;">Przemyslaw Pawlicki</h3><br /><br /> <br /><span style="font-family: 'Titillium Web' !important;">Mialem niejednokrotnie okazje testowac akcesoria Astromal do maszyn zuzlowych. Stwierdzam - Rewelacja! Sa lekkie i bardzo wytrzymale jak na takie ,,piorka". Po ostrej jezdzie zadnych zarysowan, nie mowiac o peknieciach czy innych uszkodzeniach. Design zostal zaprojektowany pod moje indywidualne potrzeby, a to bylo bardzo istotna sprawa przy wyborze blotnikow. <br><br>Ciezko przekazac zadowolenie w ten sposob... Przekonaj sie sam! </span><br /> </div> <div class="clear"></div> </div> </div>
